import React, { useState } from 'react';

const NewCam = () => {
  const [link, setLink] = useState("assets/footage.mov"); // Assuming 'link' is the variable holding the video file path

  return (
    <div>
      <div className="row">
        <div className="col-md-6" style={{ position: 'relative' }}>
          <select style={{ fontSize: '16px', color: '#A9DFBF', position: 'absolute', top: 0, left: "12px", zIndex: 1, backgroundColor:'#1C2833', borderRadius: '7px', padding: '3px', fontWeight: 'bold' }}>
            <option value="drivetrain">Drivetrain Cam</option>
            <option value="comms">Comms Cam</option>
            <option value="power">RA Cam</option>
            <option value="power">Lab Cam</option>
            <option value="power">Depth Cam</option>
          </select>
          <video src={link} controls style={{ zIndex: 0, width: '100%' }} />
        </div>
      </div>
    </div>
  );
};

export default NewCam;
